import React from "react";
import {Link} from 'react-router-dom'
import '../Home/Home.css'
import Login from "../Login/Login";



export default function Home() {
    return (
        <>
            <h1>Home page</h1>
            <Link to='/register'>Register</Link>
            <Login/>

            <div className="test">
                <h2>outer test</h2>
                <div className="test2">
                    <p>alaskjdflk</p>
                    <h1>innertest</h1>
                </div>
            </div>
        </>
    )
}
